import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import Array_obj from './Array';


ReactDOM.render(
<React.Fragment>

<h1>List of top five Netflix Series </h1>
<Card imgsrc={Array_obj.imgsrc}
 title={Array_obj.title}
 link={Array_obj. link}
 name={Array_obj. name}/>


<Card />
<Card />

</React.Fragment>,
document.getElementById("root")
)
